      <div className="popup-content">
        <button className="close-btn" onClick={onClose}>X</button>
        <h2>Encaissement réussi</h2>
        <p> <span> M. TETCHI </span> a payé</p>
        <h1>10.000 FCFA</h1>
        <p>et a reçu le N°</p>
        <h1>2 3 7 6</h1>
      </div>
    </div>
  );
}

